const [State, dispatch] = useReducer(reducer,{email:'', pwd:''})

  return (
    <div className={`app`}>

      <input
        className='inp_css'
     
        onChange={() => dispatch({type:'handle_email'})}
        placeholder='Enter Email'
        type='email'
      />

      <input
        className='inp_css'
  
        onChange={() => dispatch({type:'handle_pwd'})}
        placeholder='Enter Password'
        type='password'
      />


    </div>
  )
}

export default App
